var UsersControllers=angular.module("UsersControllers",[]);UsersControllers.controller("ViewUsersController",["$scope","$http",function(s,r){r.get("js/data/users.json").success(function(r){s.usersinfo=r})}]),UsersControllers.controller("UserProfileController",["$scope","$routeParams","$http",function(s,r,e){e.get("js/data/users/"+r.userId+".json").success(function(r){s.userinfo=r})}]);